import Link from "next/link";

export default ()=>(
    <header className="navbar navbar-inverse navbar-fixed-top bs-docs-nav navbar-fixed-top " role="banner">
        <div className="container">
            <div className="navbar-header">
                <button className="navbar-toggle" type="button" data-toggle="collapse" data-target=".bs-navbar-collapse">
                <span className="sr-only">Toggle navigation</span>
                <span className="icon-bar"></span>
                <span className="icon-bar"></span>
                <span className="icon-bar"></span>
                </button>
                <Link href="./">
                    <a>
                        <div className="app-logo"/> 
                    </a>
                </Link>

            </div>
            <nav className="collapse navbar-collapse bs-navbar-collapse" role="navigation">
                <ul className="nav navbar-nav">
                <li>
                    <Link href="#">Getting started</Link>
                </li>

                <li className="dropdown">
                    <a href="#" className="dropdown-toggle" data-toggle="dropdown">Dropdown <b className="caret"></b></a>
                    <ul className="dropdown-menu">
                        <li><a href="#">Action</a></li>
                        <li><a href="#">Another action</a></li>
                        <li><a href="#">Something else here</a></li>
                        <li><a href="#">Separated link</a></li>
                        <li><a href="#">One more separated link</a></li>
                    </ul>
                    </li>
                <li>
                    <Link href="#">Components</Link>
                </li>
                </ul>
            </nav>
        </div>

        <style global jsx>{`

            header{

            }
            .navbar-inverse{
                background: #fff;
                position: fixed;
                z-index: 1;
                width: 100%;
                box-shadow: 0 5px 12px rgba(0,0,0,0.25);
                border:0;

            }
            nav{
                float:right;
                padding-top:10px;
            }
            .app-logo{
                width:65px;
                height:65px;
                background-image: url(/static/img/kidneycarelogo.png);
                background-repeat: no-repeat;
                background-size: contain;
                display: inline-block;

            }.navbar-nav>li>a {
                line-height: 40px;
            }
            .nav>li>a {
                position: relative;
                display: block;
                padding: 21px 10px;
                text-transform:capitalize;
            }
            .navbar-inverse .navbar-nav>li>a {
                color: #F5F5F5;
                text-shadow: 0 1px 2px rgba(0,0,0,.6);
                font-size: 17px;
                font-weight:200;
            }
            .navbar-inverse .navbar-nav>li>a:hover {
                color: white;
                background-color: rgba(29, 40, 37, 0.22);
                border-radius: 0px;
            }

            .navbar-inverse .navbar-nav>li>a::after{
                content: '';
                width: 0;
                height: 4px;
                background: #fff;
                display: block;
                position: absolute;
                bottom: 0px;
                left: 0;
                -webkit-transition: all 0.60s;
                -moz-transition: all 0.60s;
                -o-transition: all 0.60s;
                transition: all 0.60s;
            }
            .navbar-inverse .navbar-nav>li>a:hover::after {
                width: 100%;
                -webkit-transition: all 0.60s;
                -moz-transition: all 0.60s;
                -o-transition: all 0.60s;
                transition: all 0.60s;
            }
            .navbar-inverse .navbar-nav>.active>a{
                background-color: rgba(255, 255, 255, 0);
            }
            .navbar-inverse .navbar-nav>.active>a:hover {
                color: #fff;
                background-color: rgba(127, 193, 175, 0.22);
            }

            .navbar-inverse .navbar-nav>.open>a, .navbar-inverse .navbar-nav>.open>a:focus, .navbar-inverse .navbar-nav>.open>a:hover {
                color: #fff;
                background-color: rgba(127, 193, 175, 0.22);
            }
            .dropdown-menu {
                background-color: rgba(255, 255, 255, 0.63);
                color:#000;
            }
            .sub-panel li a{
                text-transform:capitalize;
                text-shadow: 0 1px 2px rgba(0,0,0,.2);
                font-size: 17px;
                font-weight:200;
            }
            .test:hover .dropdown-menu{
                display:block;
            }

        `}

        </style>
    </header>

)
